The dietary substitution of soybean oil with HI larvae fat significantly changed the fatty acid (FA) profile of the chicken breast meat (
 Table 5). Most of the saturated FA (SFA) increased with growing HI larvae fat inclusion levels, and the most affected were lauric acid (C12:0; 
 p < 0.0001), myristic acid (C14:0; 
 p < 0.0001) and palmitic acid (C16:0; 
 p = 0.0004). Different from most SFA, C20:0 decreased with the increasing the HI larvae fat inclusion level (
 p = 0.0002). As a result, the total SFA incidence significantly (
 p < 0.0001) differed among treatments (28.8 vs. 36.5 vs. 45.8% of total FAME for C, HI50 and HI100, respectively).
